const TABS      = ["all", "1y", "5m"];

function findHeroId(query){
  const q=(query||"").trim().toLowerCase();
  if(!q) return null;
  for(const [hid,name] of Object.entries(HERO_DICT)){ if(name.toLowerCase()===q) return hid; }
  const matches = Object.entries(HERO_DICT).filter(([hid,name]) => name.toLowerCase().includes(q));
  return matches.length===1 ? matches[0][0] : null;
}

function renderTable(rows){
  if(!rows || rows.length===0) return '<div class="empty">No data for this selection.</div>';
  const headers=["Player","Team","Games","Wins","Losses","Winrate %"];
  let html='<table><thead><tr>'+headers.map(h=>"<th>"+h+"</th>").join("")+"</tr></thead><tbody>";
  for(const r of rows){
    const link = 'https://www.dotabuff.com/players/'+r.pid;
    html+=`<tr>
      <td><a href="${link}" target="_blank" rel="noopener noreferrer">${r.player}</a></td>
      <td>${r.team}</td>
      <td class="wr">${r.games}</td>
      <td class="wr">${r.wins}</td>
      <td class="wr">${r.losses}</td>
      <td class="wr">${r.winrate.toFixed(2)}</td>
    </tr>`;
  }
  html+="</tbody></table>";
  return html;
}

function rowsForSelection(src,label,team,heroId){
  const bucket = (PER_PLAYER[src]||{})[label]||{};
  const out = [];
  for(const [pidStr, heroMap] of Object.entries(bucket)){
    const meta = PLAYERS[pidStr]; if(!meta) continue;
    if(team!=="__ALL__" && (meta.team||"Unassigned")!==team) continue;
    const wl = (heroMap||{})[heroId]; if(!wl) continue;
    const wins = parseInt(wl.wins||0,10), losses = parseInt(wl.losses||0,10);
    const games = wins + losses; if(games<=0) continue;
    out.push({
      pid: pidStr,
      player: meta.name || ('Player '+pidStr),
      team: meta.team || 'Unassigned',
      games, wins, losses, winrate: games ? (wins/games*100.0) : 0
    });
  }
  out.sort((a,b)=> b.games - a.games || a.player.localeCompare(b.player));
  return out;
}

function mount(){
  const heroIn  = document.getElementById('heroInput');
  const teamSel = document.getElementById('teamSel');
  const timeSel = document.getElementById('timeSel');
  const srcSel  = document.getElementById('sourceSel');
  const mountEl = document.getElementById('tableMount');
  const heroMeta= document.getElementById('heroMeta');
  const rowsMeta= document.getElementById('rowsMeta');
  const hint    = document.getElementById('hint');

  function rerender(){
    const src = srcSel.value;           // all / pub / pro
    const tf  = timeSel.value;          // all / 1y / 5m
    const team= teamSel.value;          // __ALL__ or team
    const heroId = findHeroId(heroIn.value);

    if(!heroIn.value.trim()){
      heroMeta.textContent = 'No hero selected';
      hint.textContent = 'Type a hero name (e.g., Axe, Crystal Maiden)';
      mountEl.innerHTML = '<div class="empty">Pick a hero to see player rows.</div>';
      rowsMeta.textContent = '';
      return;
    }
    if(!heroId){
      heroMeta.textContent = 'â€¦';
      hint.textContent = 'Keep typing â€” pick a name from suggestions for an exact match.';
      mountEl.innerHTML = '<div class="empty">No unique hero match yet.</div>';
      rowsMeta.textContent = '';
      return;
    }

    hint.textContent = '';
    heroMeta.textContent = HERO_DICT[heroId] || ('Hero '+heroId);
    const rows = rowsForSelection(src, tf, team, heroId);
    rowsMeta.textContent = rows.length + ' players';
    mountEl.innerHTML = renderTable(rows);
  }

  [heroIn, teamSel, timeSel, srcSel].forEach(el => {
    el.addEventListener('input', rerender);
    el.addEventListener('change', rerender);
  });

  rerender();
}
mount();
</script>
